import {
  View,
  Text,
  ScrollView,
  useWindowDimensions,
  StyleSheet,
  Image,
  TouchableOpacity,
  Animated,
  Modal,
} from "react-native";
import React, { useEffect, useRef, useState } from "react";
import { Button, Switch, TextInput } from "@react-native-material/core";
import {
  setStoreDetailState,
  setWoocommerceState,
  storeDetailState,
  woocommerceState,
} from "state/state";
import {
  updateStoreDetails,
  updateWooCredentials,
} from "state/firebaseFunctions";
import GooglePlacesAutocomplete from "react-google-places-autocomplete";
import Foundation from "@expo/vector-icons/Foundation";
import { auth, db } from "state/firebaseConfig";
import { loadStripe } from "@stripe/stripe-js";
import firebase from "firebase/app";

const HelpModal = ({ setshowHelpModal }) => {
  const { width, height } = useWindowDimensions();
    const [screen, setscreen] = useState("home");

    const DisplayHelpScreen = () => {
        if(screen === 'manageProducts') return <ManageProducts />
    }

  return (
    <View
      style={{
        height: "100%",
        width: "100%",
      }}
    >
      <TouchableOpacity
        activeOpacity={0.9}
        style={{
          backgroundColor: "black",
          opacity: 0.5,
          height: "100%",
          width: "100%",
        }}
        onPress={() => setshowHelpModal(false)}
      />
      <View
        style={{
          height: height * 0.7,
          width: width * 0.6,
          backgroundColor: "white",
          borderTopLeftRadius: 0,
          borderRadius: 10,
          position: "absolute",
          marginLeft: "auto",
          marginRight: "auto",
          marginTop: "auto",
          marginBottom: "auto",
          left: 0,
          right: 0,
          top: 0,
          bottom: 0,
        }}
      >
        <View
          style={{
            position: "absolute",
            top: -35,
            flexDirection: "row",
          }}
        >
          <TouchableOpacity
            activeOpacity={0.9}
            onPress={() => setscreen("manageProducts")}
            style={{
              borderTopLeftRadius: 10,
              padding: 10,
              justifyContent: "center",
              alignItems: "center",
              backgroundColor:
                screen === "manageProducts" ? "#D2D2D2" : "#F5F3F3",
            }}
          >
            <Text style={[{}]}>Managing Products</Text>
          </TouchableOpacity>
          <View style={{ height: "100%", width: 1, backgroundColor: "grey" }} />
          <TouchableOpacity
            activeOpacity={0.9}
            onPress={() => setscreen("connectToWoo")}
            style={{
              padding: 10,
              justifyContent: "center",
              alignItems: "center",
              backgroundColor:
                screen === "connectToWoo" ? "#D2D2D2" : "#F5F3F3",
            }}
          >
            <Text style={[{}]}>Connecting WooCommerce</Text>
          </TouchableOpacity>
          <View style={{ height: "100%", width: 1, backgroundColor: "grey" }} />
          <TouchableOpacity
            activeOpacity={0.9}
            onPress={() => setscreen("saveCustomers")}
            style={{
              padding: 10,
              justifyContent: "center",
              alignItems: "center",
              backgroundColor:
                screen === "saveCustomers" ? "#D2D2D2" : "#F5F3F3",
            }}
          >
            <Text style={[{}]}>Saving Customers</Text>
          </TouchableOpacity>
          <View style={{ height: "100%", width: 1, backgroundColor: "grey" }} />
          <TouchableOpacity
            activeOpacity={0.9}
            onPress={() => setscreen("phoneOrder")}
            style={{
              padding: 10,
              justifyContent: "center",
              alignItems: "center",
              backgroundColor: screen === "phoneOrder" ? "#D2D2D2" : "#F5F3F3",
            }}
          >
            <Text style={[{}]}>Phone Orders</Text>
          </TouchableOpacity>
          <View style={{ height: "100%", width: 1, backgroundColor: "grey" }} />
          <TouchableOpacity
            activeOpacity={0.9}
            onPress={() => setscreen("connectPrinter")}
            style={{
              borderTopRightRadius: 10,
              padding: 10,
              justifyContent: "center",
              alignItems: "center",
              backgroundColor:
                screen === "connectPrinter" ? "#D2D2D2" : "#F5F3F3",
            }}
          >
            <Text style={[{}]}>Connecting Printer</Text>
          </TouchableOpacity>
          <View style={{ height: "100%", width: 1, backgroundColor: "grey" }} />
        </View>
        {screen === "home" ? (
          <>
            <View style={{ margin: 10 }}></View>
          </>
        ) : (
          <>
            <View style={{ margin: 10 }}></View>
          </>
        )}
      </View>
    </View>
  );
};


const ManageProducts = () => <View>
    <Text>Manage Products</Text>
</View>

const styles = StyleSheet.create({
  container: {
    alignItems: "center",
    justifyContent: "center",
    width: "100%",
    height: "100%",
  },
  headerRowContainer: {
    width: "90%",
    height: 60,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    marginBottom: 20,
  },
  headerTxt: {
    fontFamily: "archivo-600",
