    borderColor: "rgba(155,152,152,1)",
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 45,
    shadowOpacity: 0.2,
    shadowRadius: 15,
    padding: 30,
    minHeight: "75%",
    marginTop: 15,
    borderTopLeftRadius: 0,
  },
  materialStackedLabelTextbox1: {
    height: 60,
    width: 483,
  },
  materialStackedLabelTextbox2: {
    height: 60,
    width: 483,
    marginLeft: 43,
  },
  materialStackedLabelTextbox1Row: {
    height: 60,
    flexDirection: "row",
