    marginRight: 32,
  },
  materialStackedLabelTextbox4: {
    height: 60,
    width: 483,
  },
  materialStackedLabelTextbox6: {
    height: 60,
    width: 483,
    marginLeft: 43,
  },
  materialStackedLabelTextbox4Row: {
    height: 60,
    flexDirection: "row",
    marginTop: 29,
    marginLeft: 36,
    marginRight: 32,
  },
  materialStackedLabelTextbox7: {
    height: 60,
    width: 483,
  },
  materialButtonViolet2: {
    height: 48,
    width: 483,
    marginLeft: 43,
    marginTop: 12,
  },
  materialStackedLabelTextbox7Row: {
    height: 60,
    flexDirection: "row",
    marginTop: 14,
    marginLeft: 36,
    marginRight: 32,
  },
  helperDownloadContainer: {
    width: "100%",
    height: 79,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    padding: 10,
  },
  helperTxt: {
    fontFamily: "archivo-500",
    color: "#121212",
    fontSize: 19,
    width: 483,
